import React from "react";
import { makeStyles } from "@material-ui/core";

const Hr = () => {
  const classes = useStyles();
  return (
    <div>
      <div className={classes.hr}></div>
    </div>
  );
};

export default Hr;
const useStyles = makeStyles((theme) => ({
  hr: {
    paddingTop: "10px",
    paddingBottom: "10px",
    width: "150px",
    height: "1px",
    backgroundColor: "red",
    color: "purple",
  },
}));
